+ (void)drawControlDragCircle
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Color Declarations
    UIColor* white40 = [UIColor colorWithRed: 1 green: 1 blue: 1 alpha: 0.367];

    //// Shadow Declarations
    NSShadow* controlDialShadow = [NSShadow shadowWithColor: [UIColor.blackColor colorWithAlphaComponent: 0.55] offset: CGSizeMake(0.1, 2.1) blurRadius: 4];

    //// AngleDragCircle Drawing
    UIBezierPath* angleDragCirclePath = [UIBezierPath bezierPathWithOvalInRect: CGRectMake(6.5, 5.5, 24, 24)];
